import React from 'react';
import ReactDOM from 'react-dom/client';
import { ReactKeycloakProvider } from '@react-keycloak/web';
import { initKeycloak, login, getLoginUrl } from './keycloak';
import App from './App';
import axios from 'axios';

// Configure axios defaults
axios.defaults.baseURL = 'http://localhost:8080';
axios.defaults.headers.common['Content-Type'] = 'application/json';

// Add axios interceptor for authentication
axios.interceptors.request.use(config => {
    // We'll add token logic later when authentication is working
    return config;
});

// Helper function to get the current URL as a string
const getCurrentUrl = () => {
    try {
        return window.location.origin;
    } catch (error) {
        console.error('Failed to get current URL:', error);
        return window.location.origin;
    }
};

// Function to render the application after successful authentication
const renderApp = () => {
  const root = ReactDOM.createRoot(document.getElementById('root'));
  root.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );
};

// Function to render error
const renderError = (error) => {
  const errorMessage = error?.message || 'Unknown error during authentication';
  const errorDetails = error?.stack || 'No details available';

  const root = ReactDOM.createRoot(document.getElementById('root'));
  root.render(
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
      padding: '20px',
      backgroundColor: '#f8f9fa',
      color: '#343a40',
      fontFamily: 'Arial, sans-serif'
    }}>
      <div style={{
        maxWidth: '600px',
        padding: '30px',
        borderRadius: '8px',
        backgroundColor: 'white',
        boxShadow: '0 4px 6px rgba(0,0,0,0.1)',
        textAlign: 'center'
      }}>
        <h1 style={{ color: '#dc3545', marginBottom: '20px' }}>Authentication Error</h1>
        <p style={{ fontSize: '18px', marginBottom: '20px' }}>
          {errorMessage}
        </p>
        <div style={{ 
          backgroundColor: '#f8f9fa', 
          padding: '15px', 
          borderRadius: '4px', 
          textAlign: 'left',
          marginBottom: '20px',
          overflowX: 'auto'
        }}>
          <pre style={{ margin: 0, whiteSpace: 'pre-wrap', wordBreak: 'break-word' }}>
            {errorDetails}
          </pre>
        </div>

        <div style={{ display: 'flex', justifyContent: 'center', gap: '10px' }}>
          <button 
            onClick={() => {
              // Try direct login function
              login();
            }}
            style={{
              padding: '12px 24px',
              backgroundColor: '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer',
              fontSize: '16px'
            }}
          >
            Try Login Function
          </button>

          <a 
            href={getLoginUrl()}
            style={{
              display: 'inline-block',
              padding: '12px 24px',
              backgroundColor: '#28a745',
              color: 'white',
              textDecoration: 'none',
              borderRadius: '4px',
              fontSize: '16px'
            }}
          >
            Try Direct URL
          </a>
        </div>
      </div>
    </div>
  );
};

// Function to render a manual login button
const renderLoginButton = () => {
  const root = ReactDOM.createRoot(document.getElementById('root'));
  root.render(
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
      padding: '20px',
      backgroundColor: '#f8f9fa',
      color: '#343a40',
      fontFamily: 'Arial, sans-serif'
    }}>
      <div style={{
        maxWidth: '600px',
        padding: '30px',
        borderRadius: '8px',
        backgroundColor: 'white',
        boxShadow: '0 4px 6px rgba(0,0,0,0.1)',
        textAlign: 'center'
      }}>
        <h1 style={{ marginBottom: '20px' }}>Welcome to ChatSecure</h1>
        <p style={{ fontSize: '18px', marginBottom: '20px' }}>
          Please log in to access your messages and contacts.
        </p>

        <div style={{ display: 'flex', justifyContent: 'center', gap: '10px', flexWrap: 'wrap' }}>
          <button 
            onClick={() => {
              try {
                // Use the login function from keycloak.js
                login();
              } catch (error) {
                console.error('Error during login:', error);
                renderError(error);
              }
            }} 
            style={{
              padding: '12px 24px',
              backgroundColor: '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer',
              fontSize: '16px',
              marginTop: '10px'
            }}
          >
            Log in with Keycloak
          </button>

          <a 
            href={getLoginUrl()}
            style={{
              display: 'inline-block',
              padding: '12px 24px',
              backgroundColor: '#28a745',
              color: 'white',
              textDecoration: 'none',
              borderRadius: '4px',
              fontSize: '16px',
              marginTop: '10px'
            }}
          >
            Direct Login Link
          </a>
        </div>

        <div style={{ marginTop: '30px', padding: '15px', backgroundColor: '#f8f9fa', borderRadius: '4px', textAlign: 'left' }}>
          <p><strong>Debug Information:</strong></p>
          <p><strong>Current Origin:</strong> {window.location.origin}</p>
          <p><strong>Keycloak URL:</strong> http://localhost:9090</p>
          <p><strong>Realm:</strong> whatsapp-clone</p>
          <p><strong>Client ID:</strong> whatsapp-clone-app</p>
        </div>
      </div>
    </div>
  );
};

// Initialize Keycloak and render the appropriate component
const initializeApp = () => {
  console.log('Initializing application...');

  // First, render the login button while we try to initialize Keycloak
  renderLoginButton();

  // Skip automatic initialization for now and rely on manual login
  // This avoids the undefined errors we were seeing
  /*
  // Try to initialize Keycloak
  initKeycloak()
    .then(({ authenticated }) => {
      console.log('Keycloak initialization successful, authenticated:', authenticated);
      if (authenticated) {
        renderApp();
      } else {
        // User is not authenticated, keep showing the login button
        console.log('User is not authenticated, showing login button');
      }
    })
    .catch(error => {
      console.error('Keycloak initialization failed:', error);
      // Show error and login button
      renderError(error);
    });
  */
};

// Start the application
initializeApp();
